void getInputValue::rungeKutta(std::vector<double>& x_old, int sr_j) {
    int n = static_cast<int>(x_old.size());  // n = DIM+1
    // --- ルンゲ‐クッタ法による状態更新 ---
    // 第1段階
    for (int i = 0; i < n; i++) {
        double dx = fAllVec[i](x_old);
        k[i][0] = h * dx;
        r[i][0] = (k[i][0] - 2.0 * q[i][3]) / 2.0;
        x[0][i] = x_old[i] + r[i][0];
        q[i][0] = q[i][3] + 3.0 * r[i][0] - k[i][0] / 2.0;
    }   
    // 第2段階
    for (int i = 0; i < n; i++) {
        double dx = fAllVec[i](x[0]);
        k[i][1] = h * dx;
        r[i][1] = (1.0 - std::sqrt(0.5)) * (k[i][1] - q[i][0]);
        x[1][i] = x[0][i] + r[i][1];
        q[i][1] = q[i][0] + 3.0 * r[i][1] - (1.0 - std::sqrt(0.5)) * k[i][1];
    }
    // 第3段階
    for (int i = 0; i < n; i++) {
        double dx = fAllVec[i](x[0]);
        k[i][2] = h * dx;
        r[i][2] = (1.0 + std::sqrt(0.5)) * (k[i][2] - q[i][1]);
        x[2][i] = x[1][i] + r[i][2];
        q[i][2] = q[i][1] + 3.0 * r[i][2] - (1.0 + std::sqrt(0.5)) * k[i][2];
    }
    // 第4段階
    for (int i = 0; i < n; i++) {
        double dx = fAllVec[i](x_old);
        k[i][3] = h * dx;
        r[i][3] = (k[i][3] - 2.0 * q[i][2]) / 6.0;
        x_new[i] = x[2][i] + r[i][3];
        q[i][3] = q[i][2] + 3.0 * r[i][3] - k[i][3] / 2.0;
    }


    // --- 状態ベクトルの更新 ---
    //仮想ステアリングのみ、rungeKuttaで更新
	//荷台
   //t
	x_old[0]=x_new[0];
   //theta0
   x_old[3]=x_new[3];
   //phi1
   x_old[4]=x_new[4];
   //第一車両
   //phi2
	x_old[6]=x_new[6];
   //phi3
	x_old[8]=x_new[8];
   //theta3
	x_old[9]=x_new[9];
   //phi4
	x_old[10]=x_new[10];
   //theta4
	x_old[11]=x_new[11];
    //第2車両
	x_old[12]=x_new[12];
	x_old[14]=x_new[14];
	x_old[15]=x_new[15];
	x_old[16]=x_new[16];
	x_old[17]=x_new[17];
    //第3車両
	x_old[18]=x_new[18];
	x_old[20]=x_new[20];
	x_old[21]=x_new[21];
	x_old[22]=x_new[22];
	x_old[23]=x_new[23];



	Phi[1] = x_old[9] + x_old[8] - x_old[11] + PAI;
	Phi[2] = x_old[15] + x_old[14] - x_old[17];
	Phi[3] = x_old[21] + x_old[20] - x_old[23];


   
    
}

void getInputValue::getU(std::vector<double>& x_old, int sr_j) {
    // --- 制御入力の計算 ---
    // 各内部関数を呼び出して制御入力を計算
    U1(x_old, sr_j);
    U2(x_old, sr_j);
    U3(x_old, sr_j);
    U4_U5_U6(x_old, sr_j);
    U7_U8_U9(x_old, sr_j);
    U10_U11_U12(x_old, sr_j);

	ROS_INFO_THROTTLE(0.1,"getU: u1=%.3f, u2=%.3f, u3=%.3f, ...u12=%.3f",
           u1, u2, u3, u12);


}

